import React from 'react';

const InscriptionData = (props) => {
  const { contentType, content, ordinal } = props.inscription;

  return (
    <div>
      <h3>Inscription Information</h3>
      <p>Content Type: {contentType}</p>
      <p>Content: {content}</p>
      <p>Ordinal: {ordinal}</p>
    </div>
  );
};

export default InscriptionData;
